<template>  
	<div class="container">
		<header-fix :showLeft="false" centerText="我的" :showRight="false"></header-fix>
		<div class="body-content">
			<div class="myContent">
				<div class="info">
					<div class="title">
						<img class="logo" src="@/assets/img/my/user_icon.png"/>
						<span class="name">{{meetingName}}</span>
					</div>
					<div class="username-con">
						<span class="username">{{trueName}}/{{userName}}</span>
					</div>
				</div>
				<div class="list">
					<van-cell v-if="(userInfo.is_purchaser == 1 && !isMeetingEnd) || userInfo.is_super" title="订单审核" :to="{name: 'Audit'}" is-link icon="data:image/png;base64,"/>
					<van-cell v-if="!isMeetingEnd || userInfo.is_super" title="指标达成" :to="{name: 'Target'}" is-link icon="data:image/png;base64,"/>
					<van-cell title="订量汇总" :to="{name: 'Collect'}" is-link icon="data:image/png;base64,"/>
					<van-cell v-if="((userInfo.is_purchaser == 1 || (!isMeetingEnd && userInfo.is_purchaser == 1)) && userInfo.parent_id > 0) || userInfo.is_super" title="电子合同" :to="{name: 'Pact'}" is-link icon="data:image/png;base64,"/>
					
					<div class="list-item">
						<van-cell v-if="!isMeetingEnd" title="异常订单" :to="{name: 'UnusualOrder'}" is-link icon="data:image/png;base64," />
						<van-cell v-if="!isMeetingEnd" title="收藏评款" :to="{name: 'Favorite'}" is-link icon="data:image/png;base64," />
						<van-cell v-if="!isMeetingEnd || userInfo.is_super" title="订货排行" :to="{name: 'Rank'}" is-link icon="data:image/png;base64," />
						<van-cell v-if="!isMeetingEnd" title="明星店铺" :to="{name: 'Star'}" is-link icon="data:image/png;base64,"/>
					</div>
					<van-cell title="退出当前订货会" @click="loginOut()" class="list-loginout"/>
				</div>
			</div>
		</div>
		<footer-fix></footer-fix>
	</div>
</template>
<script>
import headerFix from "@/components/headerFix";
import footerFix from "@/components/footerFix";
export default {
	data() {
		return {
			trueName: '',
			userName: '',
			meetingName: '',
			userInfo: {}
		}
	},
	mounted() {
		if(localStorage.getItem('userInfo')) {
			let userInfo = JSON.parse(localStorage.getItem('userInfo'));
			this.userInfo = userInfo;
			this.trueName = userInfo.true_name;
			this.userName = userInfo.username;
		}
		if(localStorage.getItem('loginMeetingInfo')) {
			let LoginMeetingInfo = JSON.parse(localStorage.getItem('loginMeetingInfo'))
			this.meetingName = LoginMeetingInfo.name
		}
	},
	methods: {
		async loginOut(){
			await this.$dialog.confirm({
				title: '提示',
				message: '确定退出订货会？'
			});
			localStorage.removeItem('userInfo');
			localStorage.removeItem('loginCompany');
			localStorage.removeItem('loginMeetingInfo');
			this.$router.push({ name: 'SearchCompany' });
			this.$router.push({ name: 'loginCompany' });
		}
	},
	computed: {
		isMeetingEnd(){
			return this.$store.getters.getMeetingInfo;
		}
	},
	components: {
		headerFix,
		footerFix
	}
};
</script>
